import {appConstants} from "../constants/constant";


export const userInfosReducer = (state = null, action) => {
    switch(action.type) {
        case appConstants.GET_USER_INFOS:
            console.log("GET_USER_INFOS:  ",action.payload);
            return action.payload.data;
        default:
            return state;
    }
};
